import React from 'react';
import {ListGroup, Row, Col} from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`
    card: {
        border-color: black;
    }
`;
export const Home = () => (
    <Styles>
        <Row >
                <Col className="card">PLĂȚI SECURIZATE</Col>
                <Col className="card">LIVRARE ÎN 3 ORE</Col>
                <Col className="card">100% DISCREȚIE ȘI GARANȚIE</Col>
                <Col className="card">FELICITARE CADOU</Col>
        </Row>
    </Styles>
)
